import React from 'react';

const EllipsisIcon = ({ className, width = 10, height = 2 }) => (
  <div 
    className={`ellipsis-icon ${className || ''}`}
    style={{
      backgroundImage: "url('https://static.motiffcontent.com/private/resource/image/197f74679c85107-3cbc09f8-abd9-4da6-a069-72c8fc87fb6e.svg')",
      width: `${width}px`,
      height: `${height}px`,
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat'
    }}
  />
);

export default EllipsisIcon;
